import React from 'react';
import { Link } from 'react-router-dom';


class Regestration extends React.Component{
    subRegistration():void{
        alert('Submit is click!!')
    }

    render(){
        return(
            <div className="containerRegestration">
                <div className="conteiner-form">
                    <form action="#" method="GET">
                        <div className="item-firstname">
                            <div className="firstname-left">FirstName:</div>
                            <div className="firstname-right">
                                <input type="text"/>
                            </div>
                        </div>
                        <div className="item-secondname">
                            <div className="secondname-left">SecondName:</div>
                            <div className="secondname-right">
                                <input type="text"/>
                            </div>
                        </div>
                        <div className="item-email">
                            <div className="email-left">Email:</div>
                            <div className="email-right">
                                <input type="email"/>
                            </div>
                        </div>
                        <div className="item-passvord">
                            <div className="passvord-left">Passvord:</div>
                            <div className="passvord-right">
                                <input type="password" name="pasvordRegistr" id=""/>
                            </div>
                        </div>
                        <div className="item-button">
                            <button onClick={this.subRegistration} id="submit-registr">Registration</button>
                        </div>
                    </form>
                </div>
             <div>
            <Link to="/">На главную</Link>
             </div>
         </div>
        )
    }
}

